import {BarChart, XAxis, YAxis, Tooltip, Legend, Bar,CartesianGrid} from 'recharts';


const data = [
    {
        "name": "Snowflake",
        "exp": 4.2
    },

    {
        "name": "Python",
        "exp": 5
    },
    {
        "name": "SQL",
        "exp": 5
    },
    {
        "name": "Linux",
        "exp": 1
    }
]


export default function SkillBar(){
    return (

        <ResponsiveContainer width="100%" height="100%">
             <BarChart width={1000} height={630} data={data} layout='horizontal'>
                    <CartesianGrid strokeDasharray="5 5" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip />
                        <Legend />
                        <Bar dataKey="exp" stackId="a" fill="#87BBA2" />
                    </BarChart>


        </ResponsiveContainer>


    );
}
